import React, { Component } from 'react';

class WalletForm extends Component {
  render() {
    return (
      <div>
        WalletForm
        <form>
          <label>
            Valor da Despesa:
            <input data-testid="value-input" />
          </label>
        </form>
      </div>
    );
  }
}

export default WalletForm;
